import Link from 'next/link';

const About = () => (
<div>
  <ul>
    <li><Link href="/index"><a>Home</a></Link></li>
    <li><Link href="/about"><a>About</a></Link></li>
  </ul>
  <h1>
      About Next js about us page
  </h1>
  <img src="/static/aj.png" alt="My image" />
</div>
);

export default About;
